■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>コンパクトで持ち運びに便利なアルミライト!</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5435/1074569-01.jpg" width="600" height="600"><br><font size=3></font></div><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">ボディは耐久性に優れた屈強なアルミニウム合金を採用。明るく見やすい非球面レンズを搭載しています。スイッチ部が暗闇でも見える蓄光タイプ。雨の中でも使えます♪</font></td></tr></table><br><!--その他アレルギーここから--><!--保存方法と製造（販売）者情報ここから--><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">ボディは耐久性に優れた屈強なアルミニウム合金を採用。明るく見やすい非球面レンズを搭載しています。スイッチ部が暗闇でも見える蓄光タイプ。雨の中でも使えます♪</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">直径26×全長98mm</font><br><font color="#333333" size="-1">個装サイズ：20×7×4cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">約46g(電池除く)</font><br><font color="#333333" size="-1">個装重量：80g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">アルミ</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">■使用電池:単三形アルカリ乾電池×1本(別売)<br>■連続点灯時間:約2時間※アルカリ乾電池使用時(電池の性能や使用状況により異なります)<br>■光源:白色LED×1灯<br>■明るさ:80lm(照度約80lx※距離1m・中心点照度・電池初期時)<br>■防水仕様:IPX3(防雨形)</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">付属品</font></td><td align="left"><font color="#333333" size="-1">ハンドストラップ</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">中国</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
